import React from 'react';
import '../mycss/MiddleSection.module.css';

function MiddleSection() {
    return (
      <div className={styles.middleSection}>
        <div className={`${styles.infoBox} ${styles.box}`}>
          {/* Info Box Content */}
          <a href="/info">Info</a>
        </div>
        <div className={`${styles.projectsBox} ${styles.box}`}>
          {/* Projects Box Content */}
          <a href="/projects">Projects</a>
        </div>
        <div className={`${styles.contactBox} ${styles.box}`}>
          {/* Contact Box Content */}
          <a href="/contact">Contact</a>
        </div>
        <div className={`${styles.blogBox} ${styles.box}`}>
          {/* Blog Box Content */}
          <a href="/blog">Blog</a>
        </div>
      </div>
    );
  }
  export default MiddleSection;
